INSERT INTO `articles` (`id`, `title`, `description`, `text`, `portion`, `id_image`, `id_categories`, `id_username`, `views`, `date`) VALUES
(133, 'Классическая шарлотка', 'Классическая шарлотка. Важное сладкое блюдо советской и постсоветской истории. Легкое, пышное тесто, максимум яблочной начинки — у шарлотки всегда был образ приятного, простого и при этом лакомого и диетического блюда. Яблоки настоятельно рекомендуем взять из кислых сортов — вроде антоновки. Их можно класть как сырыми, так и предварительно слегка карамелизованными на сковородке. И сахара лучше не жалеть. Он магическим образом распределяется в нужном количестве в тесте, а излишки образуют сладкую корочку.', 'Разогреть духовку. Отделить белки от желтков. Белки взбить в крепкую пену с щепоткой соли, постепенно добавляя сахар. \r\nПродолжать взбивать, добавляя по одному желтки, затем разрыхлитель и муку. Тесто по консистенции должно напоминать сметану. \r\nСмазать противень растительным маслом. Вылить половину теста на противень, разложить равномерно нарезанные дольками яблоки, залить второй половиной теста. \r\nПоместить противень в разогретую духовку. 3 минуты подержать при температуре 200 градусов, затем убавить до 180 и выпекать 20-25 минут.', NULL, 87, 10, 2, 2343, '2022-08-27 17:40:51'),
(134, 'sdsdadd', 'sdadasdsadsa', 'asdasdsadsadsadsadsadsacsacsa', NULL, 88, 3, 2, 234324, '2022-08-28 21:05:27');

